import{_ as e,c as n,a5 as t,G as l,B as p,o as i}from"./chunks/framework.O9ad3XaM.js";const o="/assets/vul-perm.C2oFHm5s.png",r="/assets/vul-permNot_1.CvZjuhYb.png",A="data:image/jpeg;base64,",h="data:image/jpeg;base64,",c="/assets/vul-permNot_2.roL_HSz8.png",d="/assets/vul-check.s9Sg3o1a.png",g="/assets/if_1.DNPLphQe.png",u="/assets/if_2.Wn7rhSDO.png",b="/assets/if_3.njKwXSrB.png",B=JSON.parse('{"title":"逻辑判断","description":"","frontmatter":{"title":"逻辑判断","sidebar_position":3},"headers":[],"relativePath":"Java/advance/kether/if.md","filePath":"nitwikit/docs-java/advance/kether/if.md","lastUpdated":1727754229000}'),k={name:"Java/advance/kether/if.md"};function m(v,a,q,f,y,x){const s=p("nw-image-viewer");return i(),n("div",null,[a[0]||(a[0]=t('<h1 id="逻辑判断" tabindex="-1">逻辑判断 <a class="header-anchor" href="#逻辑判断" aria-label="Permalink to &quot;逻辑判断&quot;">​</a></h1><h2 id="布尔值-boolean" tabindex="-1">布尔值(boolean) <a class="header-anchor" href="#布尔值-boolean" aria-label="Permalink to &quot;布尔值(boolean)&quot;">​</a></h2><p>它只有两个取值，即 <strong>真(true)</strong> 和 <strong>假(false)</strong></p><p>或者说，<strong>是(true)</strong> 和 <strong>否(false)</strong></p><h2 id="权限判断-permission" tabindex="-1">权限判断(Permission) <a class="header-anchor" href="#权限判断-permission" aria-label="Permalink to &quot;权限判断(Permission)&quot;">​</a></h2><blockquote><p><a href="https://kether.tabooproject.org/list.html#Permission" target="_blank" rel="noreferrer">https://kether.tabooproject.org/list.html#Permission</a></p></blockquote><p>判断玩家是否拥有某权限，如果是，则返回 <strong>true</strong> ，否，则返回 <strong>false</strong></p><p><img src="'+o+'" alt=""></p><p>我是op，所以我拥有此权限，返回了 true</p><p>同 <a href="./basic#变量placeholderapi">PlaceholderAPI</a> 一样，<strong>Permission</strong> 也有一个简写 <strong>perm</strong></p><h2 id="判断为否-not" tabindex="-1">判断为否(Not) <a class="header-anchor" href="#判断为否-not" aria-label="Permalink to &quot;判断为否(Not)&quot;">​</a></h2><p>上面是判断拥有此权限，那么我如何判断不拥有此权限呢？</p><p><img src="'+r+'" alt=""></p><p><img src="'+A+'" alt=""></p><p>咳咳，开玩笑的，驿站怎么可能用过这么傻逼的写法呢</p><p><img src="'+h+'" alt=""></p><blockquote><p><a href="https://kether.tabooproject.org/list.html#Not" target="_blank" rel="noreferrer">https://kether.tabooproject.org/list.html#Not</a> 判断动作的返回值是否为否，即否定动作的结果。</p></blockquote><p><img src="'+c+'" alt=""></p><p>因为我拥有此权限，所以 perm 判断是 true</p><p>接着因为 not，最后的结果是 false</p><p>perm -&gt; not</p><h2 id="判断-check" tabindex="-1">判断(Check) <a class="header-anchor" href="#判断-check" aria-label="Permalink to &quot;判断(Check)&quot;">​</a></h2><blockquote><p><a href="https://kether.tabooproject.org/list.html#Check" target="_blank" rel="noreferrer">https://kether.tabooproject.org/list.html#Check</a></p></blockquote><div class="language-kether vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">kether</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>check 动作1 {symbol} 动作2</span></span></code></pre></div><p>判断 动作1 与 动作2 的关系</p><p>具体判断关系由中间的符号参数 Symbol 决定</p><ol><li>等于(==、is)：指两个值字面意思上相同。</li><li>不等于(!=、not)：指两个值字面意思上不同。</li><li>相似等于(=?、is?)：指两个值字面意思上忽略大小写的条件下相同。</li><li>绝对等于(=!、is!)：指两个值内存路径上相同。</li><li>大于(&gt;、gt)：指第一个值大于第二个值。</li><li>大于等于(&gt;=)：指第一个值大于或等于第二个值。</li><li>小于(&lt;、lt)：指第一个值小于第二个值。</li><li>小于等于(&lt;=)：指第一个值小于或等于第二个值。</li><li>右含左(in)：左侧 action A 的返回值是否属于右侧 action B 返回值的内容之一</li><li>左含右(has)：左侧 action A 是否含有右侧 action B 内容</li></ol><p><img src="'+d+'" alt=""></p><h2 id="分支判断-if-esle" tabindex="-1">分支判断(if esle) <a class="header-anchor" href="#分支判断-if-esle" aria-label="Permalink to &quot;分支判断(if esle)&quot;">​</a></h2><blockquote><p><a href="https://kether.tabooproject.org/list.html#If_&amp;_Else" target="_blank" rel="noreferrer">https://kether.tabooproject.org/list.html#If_&amp;_Else</a></p></blockquote><h3 id="单分支" tabindex="-1">单分支 <a class="header-anchor" href="#单分支" aria-label="Permalink to &quot;单分支&quot;">​</a></h3><div class="language-text vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">text</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>/vul eval if 条件 then 执行的动作</span></span></code></pre></div><p>条件判断为 <strong>true</strong> 则执行 then 后面的动作</p><p>注：这里的条件也是指动作，即 动作的返回值为 <strong>true</strong> 则执行 then 后面的动作</p><p><img src="'+g+`" alt=""></p><p>上面只是执行单个动作，那么，如何让他判断 <strong>true</strong> 后执行多行动作？</p><div class="language-text vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">text</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>if 条件 then {</span></span>
<span class="line"><span>    语句1</span></span>
<span class="line"><span>    语句2</span></span>
<span class="line"><span>    语句3</span></span>
<span class="line"><span>}</span></span></code></pre></div><h3 id="双分支" tabindex="-1">双分支 <a class="header-anchor" href="#双分支" aria-label="Permalink to &quot;双分支&quot;">​</a></h3><div class="language-text vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">text</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>/vul eval if 条件 then true执行的动作 else false执行的动作</span></span></code></pre></div><ul><li>条件为 true 执行 then 后面的动作</li><li>条件为 false 执行 else 后面的动作</li></ul><p>执行多行动作</p><div class="language-text vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">text</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>if 条件 then {</span></span>
<span class="line"><span>    语句1</span></span>
<span class="line"><span>    语句2</span></span>
<span class="line"><span>} else {</span></span>
<span class="line"><span>    语句3</span></span>
<span class="line"><span>    语句4</span></span>
<span class="line"><span>}</span></span></code></pre></div><h3 id="多分支" tabindex="-1">多分支 <a class="header-anchor" href="#多分支" aria-label="Permalink to &quot;多分支&quot;">​</a></h3><p>if动作的连续使用</p><div class="language-text vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">text</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>/vul evel if 条件1 then 动作1 else if 条件2 then 动作2 else if 条件3 then 动作3</span></span></code></pre></div><p>多行语句</p><div class="language-text vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">text</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>if 条件1 then {</span></span>
<span class="line"><span>    动作1</span></span>
<span class="line"><span>    动作2</span></span>
<span class="line"><span>} else if 条件2 then {</span></span>
<span class="line"><span>    动作3</span></span>
<span class="line"><span>    动作4</span></span>
<span class="line"><span>} else if 条件3 then {</span></span>
<span class="line"><span>    动作5</span></span>
<span class="line"><span>    动作6</span></span>
<span class="line"><span>}</span></span></code></pre></div><h2 id="多分支-case-when" tabindex="-1">多分支(Case &amp; When) <a class="header-anchor" href="#多分支-case-when" aria-label="Permalink to &quot;多分支(Case &amp; When)&quot;">​</a></h2><blockquote><p><a href="https://kether.tabooproject.org/list.html#Case_&amp;_When" target="_blank" rel="noreferrer">https://kether.tabooproject.org/list.html#Case_&amp;_When</a></p></blockquote><h3 id="单动作" tabindex="-1">单动作 <a class="header-anchor" href="#单动作" aria-label="Permalink to &quot;单动作&quot;">​</a></h3><div class="language-kether vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">kether</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>if check player name == postyizhan then tell &quot;是驿站！&quot;</span></span>
<span class="line"><span>else if check player name == lilingfeng then tell &quot;是驿站的黑奴&quot;</span></span>
<span class="line"><span>else if check player name == MC_jiaolong then tell &quot;这也是黑奴&quot;</span></span>
<span class="line"><span>else tell&quot;这谁啊&quot;</span></span></code></pre></div><p>上面的改成 Case &amp; When 就是</p><div class="language-kether vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">kether</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>case player name [</span></span>
<span class="line"><span>  when postyizhan -&gt; tell &quot;是驿站！&quot;</span></span>
<span class="line"><span>  when lilingfeng -&gt; tell &quot;是驿站的黑奴&quot;</span></span>
<span class="line"><span>  when MC_jiaolong -&gt; tell &quot;这也是黑奴&quot;</span></span>
<span class="line"><span>  else tell &quot;这谁啊&quot;</span></span>
<span class="line"><span>]</span></span></code></pre></div><h3 id="多动作" tabindex="-1">多动作 <a class="header-anchor" href="#多动作" aria-label="Permalink to &quot;多动作&quot;">​</a></h3><p>当然他也可以写多行动作</p><div class="language-kether vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">kether</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>case player name [</span></span>
<span class="line"><span>  when postyizhan -&gt; {</span></span>
<span class="line"><span>    tell &quot;是驿站！&quot;</span></span>
<span class="line"><span>    tell &quot;驿站请和我结婚&quot;</span></span>
<span class="line"><span>  }</span></span>
<span class="line"><span>  when lilingfeng -&gt; tell &quot;是驿站的黑奴&quot;</span></span>
<span class="line"><span>  when MC_jiaolong -&gt; tell &quot;这也是黑奴&quot;</span></span>
<span class="line"><span>  else tell &quot;这谁啊&quot;</span></span>
<span class="line"><span>]</span></span></code></pre></div><h3 id="逻辑判断-1" tabindex="-1">逻辑判断 <a class="header-anchor" href="#逻辑判断-1" aria-label="Permalink to &quot;逻辑判断&quot;">​</a></h3><p>他还可以进行逻辑判断！</p><p>单动作和多动作放一起展示了</p><div class="language-kether vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">kether</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>case 1 [</span></span>
<span class="line"><span>    when &lt; 10 -&gt; {</span></span>
<span class="line"><span>        tell &quot;这个数比10小&quot;</span></span>
<span class="line"><span>    }</span></span>
<span class="line"><span>    when &gt; 10 -&gt; log &quot;这个数比10大&quot;</span></span>
<span class="line"><span>    else log &quot;一样大&quot;</span></span>
<span class="line"><span>]</span></span></code></pre></div><h2 id="多条件判断" tabindex="-1">多条件判断 <a class="header-anchor" href="#多条件判断" aria-label="Permalink to &quot;多条件判断&quot;">​</a></h2><h3 id="全部满足-all" tabindex="-1">全部满足(All) <a class="header-anchor" href="#全部满足-all" aria-label="Permalink to &quot;全部满足(All)&quot;">​</a></h3><blockquote><p><a href="https://kether.tabooproject.org/list.html#All" target="_blank" rel="noreferrer">https://kether.tabooproject.org/list.html#All</a> 判断动作列表的所有返回值是否均为是。</p></blockquote><div class="language-kether vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">kether</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>all [ 动作1 动作2 动作3 更多 ]</span></span></code></pre></div><p>例如：</p><div class="language-text vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">text</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>/vul eval if all [ perm vulpecula.command not perm luckperms.editor ] then tell 通过 else 不通过</span></span></code></pre></div><p>玩家拥有权限 vulpecula.command 没有权限 luckperms.editor 则通过，否则不通过</p><p><img src="`+u+'" alt=""></p><h3 id="一个满足-any" tabindex="-1">一个满足(Any) <a class="header-anchor" href="#一个满足-any" aria-label="Permalink to &quot;一个满足(Any)&quot;">​</a></h3><blockquote><p><a href="https://kether.tabooproject.org/list.html#Any" target="_blank" rel="noreferrer">https://kether.tabooproject.org/list.html#Any</a> 判断动作列表的所有返回值是否含有是。</p></blockquote><div class="language-kether vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">kether</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>any [ 动作1 动作2 动作3 更多 ]</span></span></code></pre></div><p>例如：</p><div class="language-text vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">text</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>/vul eval if any [ perm vulpecula.command not perm luckperms.editor ] then tell 通过 else 不通过</span></span></code></pre></div><p><em>玩家拥有权限 vulpecula.command</em> 和 <em>没有权限 luckperms.editor</em> 满足其中一个或多个就通过</p><p><img src="'+b+`" alt=""></p><h3 id="妙妙写法" tabindex="-1">妙妙写法 <a class="header-anchor" href="#妙妙写法" aria-label="Permalink to &quot;妙妙写法&quot;">​</a></h3><h4 id="all-any多行" tabindex="-1">all_any多行 <a class="header-anchor" href="#all-any多行" aria-label="Permalink to &quot;all_any多行&quot;">​</a></h4><div class="language-kether vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">kether</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>all [ 条件1 条件2 ]</span></span>
<span class="line"><span>any [ 条件1 条件2]</span></span>
<span class="line"><span>### 等价于</span></span>
<span class="line"><span>all [</span></span>
<span class="line"><span>    条件1</span></span>
<span class="line"><span>    条件2</span></span>
<span class="line"><span>]</span></span>
<span class="line"><span>any [</span></span>
<span class="line"><span>    条件1</span></span>
<span class="line"><span>    条件2</span></span>
<span class="line"><span>]</span></span></code></pre></div><h4 id="判断null字符串" tabindex="-1">判断null字符串 <a class="header-anchor" href="#判断null字符串" aria-label="Permalink to &quot;判断null字符串&quot;">​</a></h4><p>如果一个动作，变量，或者其他什么东西会有输出null的情况，而你想判断这个情况</p><p>但是 <code>null</code> 是一个已有的动作：<a href="https://kether.tabooproject.org/list.html#Null" target="_blank" rel="noreferrer">https://kether.tabooproject.org/list.html#Null</a></p><blockquote><p>返回一个空值。</p></blockquote><p>可是我想判断的是 <code>null</code> 这四个字母！这咋办？</p><p>还记得之前学的 <a href="./basic#actiontoken和literal">literal</a> 吗？</p><div class="language-yaml vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">yaml</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">check 你要判断的东西 == literal null</span></span></code></pre></div><p>告诉kether我要的null是个字符串而不是使用 null动作</p><h4 id="判断空值" tabindex="-1">判断空值 <a class="header-anchor" href="#判断空值" aria-label="Permalink to &quot;判断空值&quot;">​</a></h4><p><a href="https://kether.tabooproject.org/list.html#Pass" target="_blank" rel="noreferrer">https://kether.tabooproject.org/list.html#Pass</a></p><blockquote><p>返回一个空字符串。</p></blockquote><div class="language-yaml vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">yaml</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">check 你要判断的东西 == pass</span></span></code></pre></div>`,90)),l(s)])}const E=e(k,[["render",m]]);export{B as __pageData,E as default};
